import React from 'react';
import './ProgressBar.scss';

function Progress() {
  const percentage = 65; // Adjust the percentage as needed

  // Calculate the circumference of the circle based on the radius
  const radius = 50; // Adjust the radius as needed
  const circumference = 2 * Math.PI * radius;
  const progressOffset = ((100 - percentage) / 100) * circumference;

  return (
    <div className="ProgressBar">
      <div className='top'></div><div className="title">
        <h2>Customers</h2>
      </div>
      <p>Customers that buy products</p>
      <div className="circle-progress">
        <svg className="circle-progress-svg">
          <circle
            className="circle-progress-bar"
            r={radius}
            cx={radius}
            cy={radius}
            strokeDasharray={circumference}
            strokeDashoffset={progressOffset}
          ></circle>
        </svg>
        <div className="progress-text">
          <div className="centered-text">Total New Customers</div>
        </div>
      </div>
    </div>
  );
}

export default Progress;
